package br.unifor.pin.agendamento.ws;

import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;
import java.net.URISyntaxException;

import javax.servlet.http.HttpServletRequest;
import javax.ws.rs.GET;
import javax.ws.rs.Path;
import javax.ws.rs.PathParam;
import javax.ws.rs.Produces;
import javax.ws.rs.core.Context;
import javax.ws.rs.core.Response;

import org.apache.tomcat.util.codec.binary.Base64;
import org.springframework.stereotype.Component;

import com.sun.jersey.spi.resource.Singleton;

@Component
@Singleton
@Path("/teste")
public class TesteImageResource {

	
	@GET
	@Path("/{matricula}/image")
	@Produces("application/json")
	public Response salvarSolicitacao(@PathParam(value = "matricula") String matricula, @Context HttpServletRequest request) throws IOException, URISyntaxException{
		String image = "";
		byte[] data = Base64.decodeBase64(image);
		
	     String path = request.getRealPath("");           
		
		String fullPath = "C:\\Users\\Daniel\\git\\Agendamento-Unifor\\src\\main\\webapp\\resources\\img\\perfil\\";
		String filename = matricula + ".png";
		
		try (OutputStream stream = new FileOutputStream(new File(path+"/resources/img/perfil"+"/"+filename))) {
			stream.write(data);
		}catch(IOException e){
			e.printStackTrace();
		}
		
		return Response.status(200).entity("{}").build();
	}
	
	
}
